import React from 'react';
import Role from "./Roles"
import "../App.css"

const RoleList = (props) => {
    if (props["clashteam"]["players"] != undefined) {
        return (
            <div style={{
                display: "flex",
                justifyContent: "center",
                alignItems: "center"
            }} className="rowC">
                <Role name={props["clashteam"]["players"].map((value, index) => <h1 key={index}>{value.name}</h1>)}/>
            </div>
        );
    }
    else return (<div></div>);
}

export default RoleList;
